import React, { Component } from 'react';
import { getBiggerThumbnailUrl } from '../../helpers/tools';
import 'materialize-css/dist/css/materialize.min.css';
import './card.css';

class Card extends Component {
    render() {
        const image = getBiggerThumbnailUrl(this.props.model.thumbnails);
        const description = this.props.model.description.substr(0, 230) + (this.props.model.description.length > 230 ? '...' : '');
        return (
            <div className="col s12 m6 l4">
                <div className="card">
                    <div className="card-image">
                        <img src={image} alt="Model print"></img>
                        <span className="card-title">{this.props.model.name}</span>
                    </div>
                    <div className="card-content">
                        <p>{description}</p>
                    </div>
                    <div className="card-action">
                        <a href="#">This is a link</a>
                    </div>
                </div>
            </div>
        );
    }
}

export default Card;
